$(document).ready(function () {
    // Verificar si la tabla ya está inicializada
    if (!$.fn.DataTable.isDataTable('#elementosTable')) {
    $('#elementosTable').DataTable({
        "paging": true,
        "lengthChange": true,
        "searching": true,
        "ordering": true,
        "info": true,
        "autoWidth": false,
        "responsive": true,
        "language": {
            "lengthMenu": "",
            "zeroRecords": "No se encontraron registros",
            "info": "Mostrando página _PAGE_ de _PAGES_",
            "infoEmpty": "No hay registros disponibles",
            "infoFiltered": "(filtrado de MAX registros totales)",
            "search": "Buscar:",
            "paginate": {
                "first": "Primero",
                "last": "Último",
                "next": "Siguiente",
                "previous": "Anterior"
            }
        },
        
        
        dom: 'lBfrtip',
        buttons: [

            {
                text: 'Filas',
                className: 'btn-fila',
                attr: { style: 'background-color: #000000; color: white;'},
                action: function (e, dt, node, config) {
                    // Crear un menú desplegable con las opciones de longitud
                    var menuHtml = '<div class="dropdown-menu" style="display: block;">' +
                        '<a class="dropdown-item" href="#" data-value="1">1 fila</a>' +
                        '<a class="dropdown-item" href="#" data-value="5">5 filas</a>' +
                        '<a class="dropdown-item" href="#" data-value="10">10 filas</a>' +
                        '<a class="dropdown-item" href="#" data-value="20">20 filas</a>' +
                        '</div>';

                    // Añadir el menú desplegable al botón
                    $(node).siblings('.dropdown-menu').remove(); // Eliminar cualquier menú existente
                    $(node).after(menuHtml);

                    // Manejar el clic en los elementos del menú
                    $(node).siblings('.dropdown-menu').find('a').on('click', function (e) {
                        e.preventDefault();
                        var value = $(this).data('value');
                        dt.page.len(value).draw(); // Cambiar la longitud de la página
                        $(node).siblings('.dropdown-menu').remove(); // Ocultar el menú después de la selección
                    });
                },
                className: 'btn btn-primary'
            },

            {
                extend: 'copy',
                text: 'Copiar',
                className: 'btn-copy',
                attr: { style: 'background-color: #737373; color: white;'},
            },
            {
                extend: 'csv',
                text: 'CSV',
                className: 'btn-csv',
                attr: { style: 'background-color: #FFA500; color: white;'},
                exportOptions: {
                    columns: function (index, data, node) {
                        return index !== $('#elementosTable').find('thead th').length - 1;
                    }
                }
            },

            {
                extend: 'excel',
                text: 'Excel',
                className: 'btn-excel',
                attr: {
                    style: 'background-color: #006400; color: white;' // Estilo para el botón Excel
                },
                title: 'Ardecors Sport - Inventario',
                filename: 'Ardecors_sport_inventario',
                exportOptions: {
                    columns: ':not(:last-child)'
                }
            },

                {
                extend: 'pdf',
                text: 'PDF',
                className: 'btn-pdf',
                attr: {
                    style: 'background-color: #8E0215; color: white;'},
                title: '',
                filename: 'Ardecors sport - Inventario',
                customize: function (doc) {
                    // Agregar título
                    doc.content.splice(0, 0, {
                        margin: [0, 0, 0, 12],
                        alignment: 'center',
                        text: 'ARDECORS SPORT',
                        fontSize: 16,
                        bold: true
                    });
                    
                    // Estilo para la tabla
                    doc.content[1].table.headerRows = 1;
                    doc.content[1].table.widths = Array(doc.content[1].table.body[0].length).fill('*');
                    doc.content[1].table.body[0].forEach(function(cell) {
                        cell.fillColor = '#cab97d';
                        cell.color = 'black';
                        cell.alignment = 'center';
                    });
                    
                    // Estilo para las filas de datos
                    for (var i = 1; i < doc.content[1].table.body.length; i++) {
                        doc.content[1].table.body[i].forEach(function(cell) {
                            cell.alignment = 'center';
                        });
                    }
                    
                    // Agregar marca de agua
                    var logoBase64 = '';

                    function base64ToUint8Array(base64) {
                        var raw = atob(base64);
                        var uint8Array = new Uint8Array(raw.length);
                        for (var i = 0; i < raw.length; i++) {
                            uint8Array[i] = raw.charCodeAt(i);
                        }
                        return uint8Array;
                    }

                    // Convertir base64 a Uint8Array
                    var logoUint8Array = base64ToUint8Array(logoBase64);


                    // Intentar agregar la imagen como fondo
                    if (logoUint8Array.length > 0) {
                        doc.images = doc.images || {};
                        doc.images['logo'] = 'data:image/png;base64,' + logoBase64;
                    
                        doc.background = function(currentPage, pageSize) {
                            // Definir el tamaño deseado de la imagen (por ejemplo, 50% del ancho de la página)
                            var desiredWidth = pageSize.width * 0.4;
                            var desiredHeight = pageSize.height * 0.3;
                    
                            // Calcular la posición para centrar la imagen
                            var x = (pageSize.width - desiredWidth) / 2;
                            var y = (pageSize.height - desiredHeight) / 2;
                    
                            return {
                                image: 'logo',
                                width: desiredWidth,
                                height: desiredHeight,
                                x: x,
                                y: y,
                                opacity: 0.3
                            };
                        };
                    }
                    // Agregar marco a la tabla
                    doc.content[1].layout = {
                        hLineWidth: function(i, node) { return 1; },
                        vLineWidth: function(i, node) { return 1; },
                        hLineColor: function(i, node) { return '#000'; },
                        vLineColor: function(i, node) { return '#000'; },
                        paddingLeft: function(i, node) { return 4; },
                        paddingRight: function(i, node) { return 4; },
                        paddingTop: function(i, node) { return 2; },
                        paddingBottom: function(i, node) { return 2; }
                    };
                },
                exportOptions: {
                    columns: ':not(:last-child)' // Excluye la última columna (acciones)
                }
            },

            {
                extend: 'print',
                text: 'Imprimir',
                className: 'btn-print',
                attr: { style: 'background-color: #001BFF; color: white;'},
                exportOptions: {
                    columns: function (index, data, node) {
                        return index !== $('#elementosTable').find('thead th').length - 1;
                    }
                },
                customize: function (win) {
                    // Agregar marca de agua textual en la impresión
                    $(win.document.body).find('table').addClass('logoBase64');
            
                    // Crear el div para la marca de agua
                    $(win.document.body).append('<div class="print-watermark">ARDECORS - SPORT</div>');
            
                    // Estilo para la marca de agua
                    $(win.document.body).find('.print-watermark').css({
                        position: 'absolute',
                        top: '50%',
                        left: '50%',
                        width: '100%',
                        textAlign: 'center',
                        fontSize: '36px',
                        color: 'gray',
                        opacity: '0.3',
                        transform: 'translate(-50%, -50%) rotate(-30deg)',
                        zIndex: '1000',
                        pointerEvents: 'none'
                    });
            
                    // Ajustar los márgenes del documento según normas ICONTEC
                    $(win.document.body).css({
                        margin: '3cm'
                    });
            
                    // Ajustar el estilo de la tabla para evitar problemas de paginación
                    $(win.document.body).find('table').css({
                        margin: '20',
                        padding: '20',
                        width: '100%',
                        pageBreakInside: 'auto'
                    });
                    $('#elementosTable_info').css('margin-top', '30px');
                }
            
            }
        ],
    });
    }
    $('<style>')
        .prop('type', 'text/css')
        .html(`
            .dataTables_wrapper .dataTables_length select {
                padding: 6px 30px 6px 10px;
                margin: 0 8px;
            }
            .dataTables_wrapper .dataTables_filter input {
                margin-left: 8px;
                padding: 6px 10px;
            }
            .dataTables_wrapper .dataTables_info {
                padding-top: 10px;
            }
            .dataTables_wrapper .dataTables_paginate {
                padding-top: 10px;
            }
            .dataTables_wrapper .dataTables_paginate .paginate_button {
                padding: 5px 12px;
                margin: 0 3px;
            }
            .dt-buttons {
                padding-bottom: 15px;
            }
            table.dataTable thead th, table.dataTable thead td {
                padding: 12px 18px;
            }
            table.dataTable tbody td {
                padding: 10px 15px;
            }
            .btn {
                margin-right: 5px;
            }
        `)
        .appendTo('head');

});
